import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const StudioMegaSection = () => {
  return (
    <div
      style={{
        background: 'linear-gradient(to right, #00f7ff, #8e2eff)',
        color: 'transparent',
        WebkitTextStroke: '2px black',
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'flex-start',
        paddingTop: '6rem',
      }}
    >
      <Container fluid>
        <Row className="align-items-center justify-content-between">
          <Col xs={12} md={4} className="text-start px-4 mb-4 mb-md-0">
            <div style={{ fontWeight: 'bold', fontSize: '2rem', lineHeight: '1' }}>
              <div>VAN</div>
              <div>HOLTZ</div>
              <div>CO.</div>
            </div>
            <div className="mt-4" style={{ fontSize: '0.9rem' }}>
              <div>01 <span className="fw-bold">about</span></div>
              <div>02 <span className="fw-bold">journal</span></div>
            </div>
          </Col>

          <Col xs={12} md={7} className="text-end px-4">
            <h1
              style={{
                fontSize: '10vw',
                fontWeight: '900',
                transform: 'skewY(-5deg)',
                letterSpacing: '0.1em',
                margin: 0,
              }}
            >
              STUDIO
            </h1>
            <h1
              style={{
                fontSize: '10vw',
                fontWeight: '900',
                transform: 'skewY(-5deg)',
                letterSpacing: '0.1em',
                margin: 0,
              }}
            >
              MEGA
            </h1>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default StudioMegaSection;
